import React from "react";
import ReactDOM from "react-dom";
// import App from "./App";
const App = require('./components/App').default;
import { BrowserRouter } from "react-router-dom";


ReactDOM.render(
<BrowserRouter>
  <App/>
</BrowserRouter>,
document.getElementById("root")
);
